  \"Autonomous Micro-Modular Mobile Data Center Cloud Computing Study for Modeling,
  Simulation, Information Processing and Cyber-Security Viability Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 111,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T01:32:06.881711\",\n\t\"name\": \"autonomous-micro-modular-mobile-data-center-cloud-computing-study-for-modeling-simulation-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;Cloud computing security penetration
  testing and anomaly detection defense studies were conducted to assess the adequacy
  of cloud computing security.&amp;nbsp; Since cloud computing involves data distributed
  over wide areas and multiple devices being shared by unrelated users, the security
  challenges become increasingly complex.&amp;nbsp; Additionally, with the advent
  of cyber warfare as a threat, protecting data from theft or alteration does not
  in itself neutralize the threat, as the adversary also seeks to disrupt critical
  infrastructure and services such as penetration into data center server networks,
  and automated security access control.&amp;nbsp; It has therefore become increasingly
  important to complement security capabilities with advances in automated intelligence
  (AI) to recognize the plans of multiple agent threats (software or human) based
  on the observation of their activities. Therefore, for this project, an autonomous
  micro-modular mobile data center was used as a test/demonstration platform to study
  cloud computing security.&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
